# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - django.http.response.HttpResponseBadRequest~Subclass
    - django_ajax
    - Member[decorators].Member[HttpResponseBadRequest]
  - - django.http.response.HttpResponseServerError~Subclass
    - django_ajax
    - Member[shortcuts].Member[HttpResponseServerError]
  - - django.http.response.HttpResponse~Subclass
    - django_ajax
    - Member[encoder].Member[HttpResponse]
  - - django.http.response.HttpResponse~Subclass
    - django_ajax
    - Member[encoder].Member[TemplateResponse]
  - - django.http.response.HttpResponse~Subclass
    - django_ajax
    - Member[response].Member[HttpResponse]
  - - django.http.response.HttpResponse~Subclass
    - django_ajax
    - Member[response].Member[JSONResponse]
  - - django.http.response.HttpResponse~Subclass
    - django_ajax
    - Member[shortcuts].Member[JSONResponse]
